export const prices = [{
        name: 'Any',
        min: 0,
        max: 0,
    },
    {
        name: `₹500 to ₹5000`,
        min: 500,
        max: 50000,
    },
    {
        name: `₹5000 to ₹10000`,
        min: 5000,
        max: 10000,
    },
    {
        name: `₹50000 to ₹150000`,
        min: 50000,
        max: 100000,
    },
    {
        name: `₹150000 to ₹1000000`,
        min: 100000,
        max: 1000000,
    },
];
export const ratings = [{
        name: '4stars & up',
        rating: 4,
    },

    {
        name: '3stars & up',
        rating: 3,
    },

    {
        name: '2stars & up',
        rating: 2,
    },

    {
        name: '1stars & up',
        rating: 1,
    },
];
